```go
package main

import (
	"fmt"
	"net"
	"sync"

	"github.com/miekg/dns"
)

var (
	ipsMap   = make(map[string][]string)
	ipsMutex = sync.Mutex{}
)

func handleRequest(w dns.ResponseWriter, r *dns.Msg) {
	m := new(dns.Msg)
	m.SetReply(r)

	for _, q := range r.Question {
		ips := resolve(q)
		for _, ip := range ips {
			answer := new(dns.A)
			answer.Hdr = m.Answer.[len(m.Answer)]
			answer.Hdr.Name = q.Name
			answer.Hdr.Rrtype = dns.TypeA
			answer.Hdr.Class = q.Class
			answer.Hdr.Ttl = 300
			answer.A = net.ParseIP(ip)
			m.Answer = append(m.Answer, answer)
		}
	}

	w.WriteMsg(m)
}

func resolve(q *dns.Question) []string {
	ipsMutex.Lock()
	defer ipsMutex.Unlock()

	ips := make([]string, 0)
	for _, server := range []string{"8.8.8.8:53", "1.1.1.1:53"} {
		conn, err := net.Dial("udp", server)
		if err != nil {
			continue
		}
		defer conn.Close()

		m := new(dns.Msg)
		m.SetQuestion(q)
		m.RecursionDesired = true

		err = m. Exchange(conn)
		if err != nil {
			continue
		}

		for _, answer := range m.Answer {
			if answer.Hdr.Rrtype == dns.TypeA {
				ip := answer.A.String()
				ips = append(ips, ip)
