```c
#include <stdio.h>

int main() {
    int a = 5 * 3;
    printf("The value of a is: %d\n", a);
    return 0;
}
```

2. Dead Code Elimination: This optimization technique removes the code that is unreachable or never executed. For example, in the following code, the `printf` statement is never executed because the `if` condition is always true.

```c
#include <stdio.h>

int main() {
    if (0) {
        printf("This will never be executed.\n");
    }
    return 0;
}
```

3. Loop Invariant Code Motion (LICM): This optimization technique moves loop-invariant code outside the loop to improve locality and reduce the number of cache misses. For example, in the following code, the value of `sum` is the same for each iteration of the loop, so it can be computed before the loop.

```c
#include <stdio.h>

int main() {
    int sum = 0;
    for (int i = 0; i < 10; i++) {
        sum += i;
    }
    printf("The sum is: %d\n", sum);
    return 0;
}
